import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom';
import logo from './rainbow-poo.svg';
import './App.css';
import Home from './components/home'

class App extends Component {
  render() {
    return (
      <Router>
      <Route exact path='/' component={Home} />
      </Router>
      );
    }
  }

  export default App;
